"// 参照コピー
int[] a = {1};
int[] b = a;
b[0] = 9;
System.out.println(a[0]); // ____"

"// 参照比較
int[] a = {1};
int[] b = {1};
System.out.println(a == b); // ____"

"// 同一性比較
int[] a = {1};
int[] b = a;
System.out.println(a == b); // ____"

"// 配列出力
int[] a = {1};
System.out.println(a);
// [1]と出る？"

"// ソート
int[] a = {3■ 1};
Arrays.sort(a);
System.out.println(a[0]); // ____"

"// 内容比較
int[] a = {1};
int[] b = {1};
System.out.println(Arrays.equals(a■ b)); // ____"

"// final要素変更
final int[] a = {10};
a[0] = 20;
// 可能？"

"// final再代入
final int[] a = {10};
// a = new int[3];
// 可能？"

"// null代入
String[] s = new String[1];
s[0] = null;
// 可能？"

"// 異型代入
int[] a = new int[1];
// a[0] = 3.5;
// 結果は？"
